package Models;

public class PageModel {
	private int page;
	private int element;

	public PageModel() {
		super();
		// TODO Auto-generated constructor stub
	}

	public PageModel(int page) {
		super();
		this.page = page;
	}

	public int getPage() {
		return page;
	}

	public void setPage(int page) {
		this.page = page;
	}

	public int getElement() {
		return element;
	}

	public void setElement(int element) {
		this.element = element;
	}
	
	
}
